import React, { createContext, useEffect, useState, useContext } from 'react';
import { autocomplete } from './actions'
import { connect } from 'react-redux';


function AutomaticCities(props) {
    props.autocomplete('Tel')
    return (
        <div>
            {props.allCitiesCompleat.map(c =>{
                <li key={c.Key}>{c.name}</li>
            })}
        </div>
    )

}
const myMapStateToProps = (state) =>{
    return{
        allCitiesCompleat: state.automatic
    }
}
export default connect(myMapStateToProps, {autocomplete})(AutomaticCities);
